INSERT INTO `block` VALUES (1,'methodology','Methodology and resources','<div>The visible and modifiable dynamic chart is served by a data table which includes the yearly breakdown of names of publishers, broadcasters, billboard companies registered in Hungary, the names of newspapers, television channels, radios and news websites published by these companies, the names of their end owners and their relationship with the respective government in power. Furthermore, the table also includes the yearly breakdown of the publishers’ revenue and profit after tax. The company data was purchased from Opten, and Whitereport`s cross-media database was used to visualize media companies and their portfolios over time. At the moment changes in media ownership can be traced back to 1998.</div><div><br></div><div>The full data table includes the top 100 Hungarian publishers (based on their revenue) that also provide news services. To make it more comprehensible and easier to understand, we removed those small local publishers and media outlets that are only published locally, mostly by the local government.&nbsp; &nbsp;&nbsp;</div><div><br></div><div>Furthermore, the Center for Media, Data and Society (CMDS) at the School of Public Policy of Central European University also categorized the publishers as pro-government and not pro-government. Publishers are regarded as pro-government if they either completely openly or mostly support the politics of the ruling government. In addition, CMDS also classified publishers based on documented links to politically exposed businessmen.&nbsp; &nbsp; &nbsp;&nbsp;</div><div><br></div><div><br></div><div><br></div><div><b>Further readings, resources:</b></div><div><br></div>','en'),(2,'methodology','methodology','Impressum Deutsch - Duis sit amet tincidunt purus. Cras finibus mi ut purus pretium porttitor. Nunc sed varius ipsum. Cras a pharetra nibh. Nam sagittis urna sapien, at feugiat lacus pretium eu. Nunc nec nulla ut elit euismod auctor. D