a hírmédia kiadásával foglalkozó, Magyarországon bejegyzett kiadók, műsorszolgáltatók, plakátcégek nevét, az általuk kiadott lapok, tévék, rádiók, hírportálok címét, a végtulajdonosaikat és a kormányokhoz fűződő viszonyukat. Emellett a tábla évenkénti bontásban tartalmazza a kiadó árbevételét és adózott eredményét is. A cégadatok az Opten céginformációs szolgáltatótól, a médiavállalatok és portfólióik idősoros adatai a Whitereport cross-média adatbázis gyűjtéséből származnak. Jelenleg 1998-ig visszamenőleg lehet visszakövetni a változásokat.&nbsp;</div><div><br></div><div>A teljes adattábla a 100 legnagyobb árbevételű, hírszolgáltatással is foglalkozó magyar médiavállalatot tartalmazza. A könnyebb átláthatóság és értelmezhetőség kedvéért azonban kivettük belőlük a kisebb, csak lokális piacokon, városokban megjelenő, többnyire önkormányzati kiadású helyi kiadókat és médiumokat.&nbsp;</div><div><br></div><div>Emellett a CEU Center for Media, Data and Society az egyes kiadókat besorolta kormánypárti és nem kormánypárti kategóriákba. Kormánypártinak azt vették, amely vagy teljesen nyíltan, vagy többnyire támogatja az éppen hatalmon lévő kormány politikáját. Ezen kívül a kiadókat a hozzájuk köthető, politikailag is exponált üzletemberek érdekeltségébe is besorolták.&nbsp;</div><div><br></div><div><br></div>\r\n\r\n<p></p><p><b>Kapcsolódó anyagok, olvasmányok</b></p><p>\r\n<a href=\"https://eur-lex.europa.eu/legal-content/en/ALL/?uri=CELEX%3A32010L0013\" target=\"_blank\">Az audiovizuális szolgáltatásokról szóló uniós direktíva</a>&nbsp;</p><p>\r\n<a href=\"http://cmpf.eui.eu/media-pluralism-monitor/\" target=\"_blank\">Media Pluralism Monitor</a>&nbsp; </p><p>Magyar médiatörvény\r\n2010. évi CLXXXV. <a href=\"https://net.jogtar.hu/jogszabaly?docid=A1000185.TV\" target=\"_blank\">Törvény a médiaszolgáltatásokról és a tömegkommunikációról, V. fejezet: A piaci koncentráció megelőzése és a jelentős befolyásoló erejű médiaszolgáltatók</a>&nbsp; <br><br></p><p><b>Szabályozás\r\n</b></p><p> \r\nGálik, Mihály: Regulating Media Concentration within the Council of Europe and the European Union, In: Beata Klimkiewitz (ed.): Media Freedom and Pluralism. Budapest, CEU Press, 2010, pp. 229-244 </p><p>Urbán Ágnes: <a href=\"http://www.mediapiac.com/mediapiac/A-mediakoncentracio-meresenek-nehany-modszertani-kerdese/112372/\" target=\"_blank\">A médiakoncentráció mérésének néhány módszertani kérdése</a>&nbsp; </p><p>Polyák Gábor: <a href=\"http://www.akti.hu/dok/fuzet21.pdf\" target=\"_blank\">Versenyjogi és médiajogi eszközök a médiakoncentráció korlátozásában</a>, AKTI 2008&nbsp; </p><p>Gálik Mihály (szerk.): A médiakoncentráció szabályozása, Budapest, Gondolat, 2011\r\n<br><br></p><p><b> \r\nKlasszikusok\r\n</b></p><p> \r\nBagdikian, Ben H.: The Media Monopoly. New York, Beacon Press, 1983\r\n</p><p>\r\nBagdikian, Ben H.: Az új médiamonpólium. Budapest, Complex, 2012.\r\n</p><p> \r\nGillian Doyle: Media Ownership: The Economics and Politics of Convergence and Concentration in the UK and European Media. Sage, 2002\r\n</p><p> \r\nRice, Ronald E.: Media Ownership – Research and Regulation. Hampton Press, 2008\r\n</p><p> \r\nNoam, Eli M. (szerk.): Who Owns the World’s Media? Media Concentration and Ownership around the World. Oxford, Oxford University Press 2016\r\n \r\n \r\n<br><br></p><p><b>Magyarország\r\n</b></p><p> \r\n<a href=\"http://cmpf.eui.eu/media-pluralism-monitor/mpm-2016-results/hungary/ http://cadmus.eui.eu/bitstream/handle/1814/46799/Cover_Hungary_O.pdf?sequence=2&amp;isAllowed=y\" target=\"_blank\">Media Pluralism Monitor&nbsp;</a></p>','hu'),(4,'introduction','introduction','Introduction Deutsch - Suspendisse a aliquet massa. Etiam sed ante in diam molestie sollicitudin. Vivamus vulputate lacus diam, nec auctor urna lacinia ac. Quisque elementum tempor scelerisque. Donec id dui lacus. Ut in mauris fermentum, varius purus ac, consequat felis. ','de'),(5,'introduction','introduction','A Media Ownership Tool (MOT) egy online eszköz, amellyel könnyen átláthatod és követheted a magyar média tulajdonosi szerkezetének változását.&nbsp; ','hu'),(6,'introduction','introduction','The Media Ownership Tool (MOT) is an online tool to view and track changes in Hungarian media ownership. ','en'),(7,'about','about','<div>The Media Ownership Tool (MOT) is an online tool to view and track changes in Hungarian media ownership.</div><div><br></div><div>In the past few years, questions related to media concentration, information and opinion monopolies and links between media owners and political interests have come to the forefront not only in Hungary but all across the globe. Those who are interested in the topic had to make do with long data tables and complicated articles that are often hard to follow, if they wanted to gain an understanding of the gravity of the problem. As an alternative, we decided to make the problem more comprehensible through dots, lines, circles and colors, while at the same time allow users to browse and filter charts and to modify them in accordance with certain variables. We hope that this tool helps clarify the issues around Hungarian media ownership and gives a nuanced understanding of the proportions. Furthermore, we also intend this tool to serve as an example of how to answer similar questions around media concentration in other countries.&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</div><div><br></div><div><b>Who is it for?</b></div><div><br></div><div>The Media Ownership Tool is primarily intended for Hungarian and foreign citizens, journalists, media consumers, economists and lawmakers, who are interested in questions related to Hungarian media ownership and are able to use the information extracted with the help of the Media Ownership Tool in their work.&nbsp;&nbsp;</div>','en'),(8,'about','about','About Deutsch - Duis sit amet tincidunt purus. Cras finibus mi ut purus pretium porttitor. Nunc sed varius ipsum. Cras a pharetra nibh. Nam sagittis urna sapien, at feugiat lacus pre