ted a magyar média tulajdonosi szerkezetének változását.&nbsp;</div><div><br></div><div>Az utóbbi években nemcsak Magyarországon, hanem a világ minden pontján újra előtérbe kerültek a média koncentrációjának, az információ- és véleménymonopóliumoknak, valamint a tulajdonosok, politikai érdekeltségek összefonodásainak kérdései. A téma iránt érdeklődők hosszú adattáblákból, sokszor követhetetlenül bonyolult cikkekből próbáltak képet kapni a probléma valódi súlyáról. Mi ehelyett azt választottuk, hogy pontokkal, vonalakkal, körökkel és színekkel próbáljuk közérthetőbbé tenni a problémát, de emellett lehetőséget biztosítunk a felhasználónak arra is, hogy az ábrát saját igényeinek és érdeklődéseinek megfelelően szűrhesse, böngészhesse, és bizonyos változók szerint átalakíthassa. Reményeink szerint ezzel az eszközzel hozzájárulunk a hazai médiatulajdonosi viszonyok tisztábban látásához és az arányok pontosabb megállapításához is, emellett példát szeretnénk nyújtani más országok hasonló kérdéseinek megválaszolásához is.</div><div><br></div><div><b>Kiknek készült?</b></div><div><br></div><div>Elsősorban olyan hazai és külföldi állampolgárok, újságírók, médiakutatók, közgazdászok és állami döntéshozók számára, akik egyfelől érdeklődnek a magyarországi média tulajdonviszonyai iránt, másfelől munkájuk során fel tudják használni az eszközzel nyert információt.&nbsp;</div>','hu'),(10,'impressum','impresszum','<div><b>Kiadó</b></div><div>Central European University – Center for Media, Data and Society<br>Budapest 1051 Nádor utca 9.</div><div><br></div><div><b>Projektfelelős</b></div><div>Bognár Éva, Bátorfy Attila</div><div><br></div><div><b>Fejlesztés, adatvizualizáció</b></div><div><a href=\"http://branditorial.hu\" target=\"_blank\">Branditorial</a></div><div><br></div><div><b>Adatok</b></div><div>Whitereport</div><div><br></div><div><b>Kapcsolat</b><br>cmds@ceu.edu</div><div><b><br></b></div><div><div><b>Finanszírozás</b></div><div>A projekt finanszírozására a CEU CMDS a&nbsp;<a href=\"https://newsinitiative.withgoogle.com/dnifund/\" target=\"_blank\">Google Digital News Innovation Fund</a>&nbsp;programján nyert 50.000 Euró pályázati összeget.<br></div></div>','hu'),(11,'impressum','impressum','<div><b>Publisher</b><br>Center for Media, Data and Society (CMDS) at the School of Public Policy of Central European University&nbsp;<br></div><div>1051 Budapest, Nádor utca 9.</div><div><b><br></b></div><div><b>Project managers</b></div><div>Éva Bognár, Attila Bátorfy</div><div><br></div><div><b>Development and data visualization</b></div><div>Branditorial</div><div><br></div><div><b>Data</b></div><div>Whitereport</div><div><b><br></b></div><div><b>Contact</b><br>cmds@ceu.edu&nbsp;</div><div><br></div><div><div><b>Funding</b></div><div>CMDS won 50.000 EUR grant from the Google Digital News Initiative through its Digital News Innovation Fund for the funding of the project.&nbsp;<br></div></div>','en'),(12,'impressum','impressum','Impressum Deutsch - Duis sit amet tincidunt purus. Cras finibus mi ut purus pretium porttitor. Nunc sed varius ipsum. Cras a pharetra nibh. Nam sagittis urna sapien, at feugiat lacus pretium eu. Nunc nec nulla ut elit euismod auctor. Duis id consectetur lacus. Aliquam erat volutpat. Aliquam erat volutpat. Pellentesque vulputate, tortor vel blandit fringilla, sem neque blandit lorem, sed vulputate nisl magna in tortor. Sed congue sapien quis est semper, a vehicula mi pulvinar. Curabitur pulvinar sapien id ligula sagittis suscipit. Maecenas dictum, neque ultrices aliquam accumsan, ante nunc vulputate magna, ac ultrices sapien nulla sit amet mi. Vestibulum ante ipsum primis in faucibus orci luctus et ultrices posuere cubilia Curae; Sed sollicitudin lacus diam, sit amet rutrum libero facilisis sed. Curabitur feugiat eleifend nisl ut vulputate. Etiam eleifend nibh eget massa aliquam, at volutpat turpis porttitor. Aliquam diam sapien, vestibulum sed tincidunt quis, interdum vitae quam. Class aptent taciti sociosqu ad litora t